import { useRouter } from 'next/router';
import Layout from '../../components/MyLayout';
import CarList from '../../components/Lists/CarList';

export default function Post() {
  const router = useRouter();

  return (
    <Layout>
      <h3>{router.query.id}</h3>
      <CarList />
    </Layout>
  );
}
